import { useState } from "react";

const Login = () => {
    const [viewPdw, setViewPdw] = useState('password')
    return(
        <article className="content-frm-login col-12 col-sm-12 col-lg-6 col-xl-6 m-auto bg-dark">
            <form id='frm-login'>
                <input type='text' name='user'/>
                <input type={viewPdw} name='pdw'/>
                <input className='btn btn-primary' type='submit' value='Ingresar'/>
            </form>
        </article>
    )
}

export default Login;
